import React, { useState } from 'react';
import '../Navbar.css';
import { Link } from 'react-router-dom';
import closeMobileMenu from '../Navbar';
import Navbar from '../Navbar';
import Header from '../cards/Header';
import ExperienceCardHome from '../cards/Experience card short';
import EducationCard from '../cards/Education card';
import AboutCard from '../cards/About card';
import { makeStyles } from '@material-ui/core/styles';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import Card from 'react-bootstrap/Card'

// import LightMode from './LightMode'

const styles = makeStyles({
    wrapper: {
        width: "50%",
        margin: "auto",
    },
})

function Home() {
    const classes = styles();

    return (

        <div className="App">
        <Navbar />

            <style>{'body { background-color: black; }'}</style>

            <div className={classes.wrapper}>

                <Header />
                <AboutCard />
                <ExperienceCardHome />
                <Card 
                bg={'dark'} text={'white'} className={classes.smallSpace}>

                <li >
                        <Link
                            to='/experience'
                            onClick={closeMobileMenu}
                        >
                            Show all experiences â†’
                        </Link>
                        </li>
                </Card>
                <EducationCard />

                <div className={classes.largeSpace}>
                </div>
            </div>

        </div>
    );
}

export default Home;
